    };

    return (
        <>
            <Button
                variant='contained'
                sx={{
                    borderRadius: 5,
                    position: 'absolute',
                    top: '5%',
                    right: '10%'
                }}
                onClick={AddTask()}
            >
                <AddIcon />
            </Button>
            <DragDropContext onDragEnd={onDragEnd}>
                <Grid container gap={8} marginTop={'1em'} justifyContent={'center'}>
                    <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'} minHeight={550}>
                        <Droppable droppableId="droppable1">
                            {(provided) => (
                            <ul
                                {...provided.droppableProps}
                                ref={provided.innerRef}
                                style={{
                                    listStyleType: 'none',
                                    padding: '8px',
                                    margin: '8px',
                                    minHeight:'200px'
                                }}
                            >
                                {provided.placeholder}
                            </ul>
                            )}
                        </Droppable>
                    </Grid>
                    <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'}>
                        <Droppable droppableId="droppable2">
                            {(provided) => (
                            <ul
                                {...provided.droppableProps}
                                ref={provided.innerRef}
                                style={{
                                    listStyleType: 'none',
                                    padding: '8px',
                                    margin: '8px',
                                    minHeight:'200px'
                                }}
                            >
                                {provided.placeholder}
                            </ul>
                            )}
                        </Droppable>
                    </Grid>
                    <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'}>
                        These
                    </Grid>
                </Grid>
            </DragDropContext>
        </>
    );
}

export default Day;
